  function render_records() {

    data = $.csv.toArrays(csvdata);
    var row;
    var discovered = new Array;
    var gapsize = new Array;
    var merit = new Array;
    var digits = new Array;
    var blockheight = new Array;
    for (row of data) {
      discovered.push(Date.parse(row[8]));
      gapsize.push(parseInt(row[4], 10));
      merit.push(parseFloat(row[5], 10));
      digits.push(parseInt(row[6], 10));
      blockheight.push(parseInt(row[0], 10));
    }

    var margin = {top: 10, right: 15, bottom: 40, left: 80};
    var width = 1024 - margin.left - margin.right;
    var height = 600 - margin.top - margin.bottom;

    // the chart object, includes all margins
    var chart = d3.select('#records')
      .append('svg:svg')
      .attr('width', width + margin.right + margin.left)
      .attr('height', height + margin.top + margin.bottom)
      .attr('class', 'chart')

    var x = d3.scaleTime()
              .domain([new Date(d3.min(discovered)), new Date(d3.max(discovered))])  // the range of the values to plot
              .range([ 1, width ]);        // the pixel range of the x-axis

    var y = d3.scaleLinear()
            .domain([1, d3.max(gapsize)])  // the range of the values to plot
            .range([ height, 1 ]);        // the pixel range of the x-axis

    // the main object where the chart and axis will be drawn
    var main = chart.append('g')
      .attr('transform', 'translate(' + margin.left + ',' + margin.top + ')')
      .attr('width', width)
      .attr('height', height)
      .attr('class', 'main')

    main.append("text")
      .attr("fill", "teal")
      .attr("text-anchor", "end")
      .attr("x", width)
      .attr("y", height + margin.top + 20)
      .text("Discovery date");

    main.append("text")
      .attr("fill", "teal")
      .attr("text-anchor", "end")
      .attr("transform", "rotate(-90)")
      .attr("y", -margin.left+20)
      .attr("x", -margin.top)
      .text("Gap size");

    var xAxis = d3.axisBottom().scale(x);

    main.append('g')
      .attr('transform', 'translate(0,' + height + ')')
      .attr('class', 'main axis date')
      .call(xAxis);

    // draw the y axis
    var yAxis = d3.axisLeft().scale(y).ticks(10);

    main.append('g')
      .attr('transform', 'translate(0,0)')
      .attr('class', 'main axis sum')
      .call(yAxis);

    // draw the graph object
    var g = main.append("svg:g"); 

    g.selectAll("scatter-dots")
      .data(gapsize)  // using the values in the gapsize array
      .enter().append("svg:circle")  // create a new circle for each value
          .attr("cy", function (d) { return y(d); } ) // translate y value to a pixel
          .attr("cx", function (d,i) { return x(discovered[i]); } ) // translate x value
          .attr("r", 2.5) // radius of circle
          .style("fill", function (d,i) { 
            return d3.interpolateRdYlGn((merit[i] - d3.min(merit)) / (d3.max(merit) - d3.min(merit)));
          })
  };

  $(document).ready(function() {
    $('.ui.dimmer').dimmer('show');
    render_records();
    $('.ui.dimmer').dimmer('hide');
  });
  </script>
